'use strict'
import React from 'react';
import mysql from 'mysql';
//import './styles/custom.css';
//import './styles/normalize.css';
//import './styles/prog-tracker.css';
import './styles/skeleton.css';
import { Button } from 'react-bootstrap';
import { Navbar } from 'react-bootstrap';
import { Form } from 'react-bootstrap';
import { FormControl } from 'react-bootstrap';
import { Nav } from 'react-bootstrap';
import { Container } from 'react-bootstrap';

class General extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      fromCompletedBy: '',
      GPSProduct: '',
      startDate: '',
      endDate: '',
      timeZone: '',
      callDuration: '',
      startTime: '',
      endTime: '',
      callersName: '',
      callersNumber: '',
      caseID: '',
      customerName: '',
      OPInvolved: '',
      outageLevel: '',
      SDFCSAv: '',
      SDFCSC: '',
      problemSummary: '',
      callersGroup: '',
      siteLocation: '',
      ASDFCSN: ''
    }
    this.handleChange = this.handleChange.bind(this);
    this.handleClick = this.handleClick.bind(this);
    this.makeConnection = this.makeConnection.bind(this);
  }

  handleChange(event) {
    this.setState({ [event.target.name]: event.target.value });
  }
  handleClick(e) {
    e.preventDefault();
    console.log(this.state);
    alert('lan');
    this.makeConnection();

  }
  makeConnection(){
    var mysql      = require('mysql');
    var connection = mysql.createConnection({
    host     : 'localhost',
    database : 'reportengine',
    user     : 'root',
    password : 'My693914',
});

connection.connect(function(err) {
    if (err) {
        console.error('Error connecting: ' + err.stack);
        return;
    }
    console.log('Connected as id ' + connection.threadId + connection.state);
});

connection.query('SELECT * FROM generalinfo', function (error, results, fields) {
    if (error)
        throw error;

    results.forEach(result => {
        console.log(result);
    });
});

connection.end();

  }

  render() {
    return (
      <div>

        <header className='header' bg= "blue">
          GENERAL INFO</header>
        <div className='row'>
          <div className='six columns'>
            <label>From Completed By</label>
            <input name='fromCompletedBy'
              className='u-full-width'
              type='text'
              onChange={this.handleChange}
              value={this.state.fromCompletedBy}
              autoFocus
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label> GPS Product</label>
            <input name='GPSProduct'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.GPSProduct}
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label>Start Date</label>
            <input name='startDate'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.startDate}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>End Date</label>
            <input name='endDate'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.endDate}
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label>Time  Zone</label>
            <input name='timeZone'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.timeZone}
            />
          </div>
        </div>
        <div className='row'>
          <div className='six columns'>
            <label>Call Duration</label>
            <input name='callDuration'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.callDuration}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Start Time</label>
            <input name='startTime'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.startTime}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>End Time</label>
            <input name='endTime'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.endTime}
            />
          </div>
        </div>
        <hr className='hrblank' />

        <header className='header'> CALL DETAILS</header>

        <div className='row'>
          <div className='six columns'>
            <label>Callers Name: </label>
            <input name='callersName'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.callersName}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Callers Number: </label>
            <input name='callersNumber'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.callersNumber}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Case ID: </label>
            <input name='caseID'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.caseID}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Customer Name. </label>
            <input name='customerName'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.customerName}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Other People Involved: </label>
            <input name='OPInvolved'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.OPInvolved}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Outage Level</label>
            <input name='outageLevel'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.outageLevel}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>SDFC Solution Avaliable: </label>
            <input name='SDFCSAv'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.SDFCSAv}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>SDFC Solution Compexity: </label>
            <input name='SDFCSC'
              className='u-full-width'
              type='text'
              onChange={this.handleChange}
              value={this.state.SDFCSC}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>  Problem Summary: </label>
            <textarea style={{ height: '200px' }} name='problemSummary'
              className='u-full-width'

              type='textarea'
              onChange={this.handleChange}
              value={this.state.problemSummary}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Callers Group: </label>
            <input name='callersGroup'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.callersGroup}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Site Location: </label>
            <input name='siteLocation'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.siteLocation}
            />
          </div>
        </div>

        <div className='row'>
          <div className='six columns'>
            <label>Applicable SDFC Solution: </label>
            <input name='ASDFCSN'
              className='u-full-width'

              type='text'
              onChange={this.handleChange}
              value={this.state.ASDFCSN}
            />
          </div>
        </div>
        <hr className='hrblank' />
        <button onClick={this.handleClick} name='save'> Save Report</button>

      </div>
    )
  }
}
export default General;
